import { Button } from "../components/Button";
import illustrationImg from '../assets/images/illustration.svg';

export function Home() {
  return (
    <div>
      <Button />
      <aside>
        <img
          src={ illustrationImg }
          alt="Ilustração simbolizando perguntas e respostas"
        />
      </aside>
    </div>
  );
}
